import React from 'react';

const PageFirst =() =>{
    return(
        <>
            <h1 className="heading">Welcome to Table</h1>
            <div className="mt-3">
                        <NavLink to="" className="btn-get-started">{props.btname}</NavLink>
                    </div>
        </>
    )
};

export default PageFirst;
